import React, { Component } from 'react'
import '../css/Layout.css';
import 'antd/dist/antd.css';
import brand from '../images/brand.png';
import axios from 'axios';
import { productListURL} from "../constants";
import Basket from './Basket';
import Slider from '../containers/Slider';
import Filter from './Filter';
import { Menu, Pagination,Icon, Button, Input, AutoComplete} from 'antd';
const { SubMenu } = Menu;

const { Option } = AutoComplete;



class Header extends Component {
    constructor(props) {
        super(props)
        this.state = {
          size: '',
          sort: '', 
          cartItems: [],  
          filteredProducts: [], 
          dataSource: [],
          loading: false,
          error: null,
          data: [],
          openKeys: ['sub1'],

        }
     }

     rootSubmenuKeys = ['sub1', 'sub2', 'sub4'];

     componentDidMount() {


      if (localStorage.getItem('cartItems')) {
        this.setState({ cartItems: JSON.parse(localStorage.getItem('cartItems')) });
      }

       this.setState({ loading: true });
       axios
         .get(productListURL)
         .then(res => {
           this.setState({ data: res.data, loading: false });
         })
         .catch(err => {
           this.setState({ error: err, loading: false });
         });
     }


     onOpenChange = openKeys => {
       const latestOpenKey = openKeys.find(key => this.state.openKeys.indexOf(key) === -1);
       if (this.rootSubmenuKeys.indexOf(latestOpenKey) === -1) {
         this.setState({ openKeys });
       } else {
         this.setState({
           openKeys: latestOpenKey ? [latestOpenKey] : [],
         });
       }
       };

    //  componentWillReceiveProps() {

    // axios.get(productListURL)
    // .then(res=>{
    //    this.setState({ data: res.data});

    // })
    // }

    handleRemoveFromCart = (e, product) => {
      this.setState(state => {
        const cartItems = state.cartItems.filter(a => a.id !== product.id);
        localStorage.setItem('cartItems', JSON.stringify(cartItems));
        return { cartItems: cartItems };
      })
    }

    handleAddToCart = (e, product) => {
      this.setState(state => {
        const cartItems = state.cartItems;
        let productAlreadyInCart = false;

        cartItems.forEach(cp => {
          if (cp.id === product.id) {
            cp.count += 1;
            productAlreadyInCart = true;
          }
        });

        if (!productAlreadyInCart) {
          cartItems.push({ ...product, count: 1 });
        }
        localStorage.setItem('cartItems', JSON.stringify(cartItems));
        return { cartItems: cartItems };
      });
    }

    listProducts = () => {
      this.setState(state => {
        if (state.sort !== '') {
          state.data.sort((a, b) =>
            (state.sort === 'lowestprice'
              ? ((a.price > b.price) ? 1 : -1)
              : ((a.price < b.price) ? 1 : -1)));
        } else {
          state.data.sort((a, b) => (a.id > b.id) ? 1 : -1);
        }
        if (state.size !== '') {
          return { filteredProducts: state.product && state.product.filter(a => a.availableSizes.indexOf(state.size.toUpperCase()) >= 0) };
        }
        return { filteredProducts: state.product};
      })
    }

    handleSortChange = (e) => {
      this.setState({ sort: e.target.value });
      this.listProducts();
    }
    handleSizeChange = (e) => {
      this.setState({ size: e.target.value });
      this.listProducts();
    }
    handleClick = (e)=> {
      console.log('hover', e);
    }

    onSelect =(value)=> {
     console.log('onSelect', value);
   }

   getRandomInt = (max, min = 0)=> {
     return Math.floor(Math.random() * (max - min + 1)) + min; // eslint-disable-line no-mixed-operators
   }

   searchResult = (query) => {
     return new Array(this.getRandomInt(5))
       .join('.')
       .split('.')
       .map((item, idx) => ({
         query,
         category: `${query}${idx}`,
         count: this.getRandomInt(200, 100),
       }));
   }

   renderOption=(item)=> {
     return (
       <Option key={item.category} text={item.category}>
         <div className="global-search-item">
           <span className="global-search-item-desc">
             Found {item.query} on
             <a
               href={`http://localhost:8000/products?q=${item.query}`}
               target="_blank"
               rel="noopener noreferrer"
             >
               {item.category}
             </a>
           </span>
           <span className="global-search-item-count">{item.count} results</span>
         </div>
       </Option>
     );
   }

   handleSearch = value => {
     this.setState({
       dataSource: value ? this.searchResult(value) : [],
     });
   };

